import React from 'react'
import { addToCart } from './redux/action'
import { useDispatch } from 'react-redux'

export default function App() {
  const dispatch=useDispatch()
  return (
    <div>
        <button onClick={()=>dispatch(addToCart())}></button>
    </div>
  )
}
